import AmethystRingImg from './amethyst-ring.png';

const AmethystRing = {
    name: 'Amethyst Ring',
    type: 'ring',
    effect: {
        defence: 3,
        hp: 7,
        mana: 3,
    },
    image: AmethystRingImg,
    value: 125,
};

export default AmethystRing;
